import React from "react";
import "./HomePageTile.css";

function HomePageTile(props) {
    return (
        <div className="tile-container">
            <div>{props.title}</div>   
            <div className="tile-body">
                {props.items.map((item)=>item)}
            </div>        
        </div>
    );
}

export default HomePageTile;
